content:
우리는 왜 한자어랑 한글이랑 중복으로 표시할까?
외갓집, 친갓집, 손수건, 몇월달...
보다보니 갑자기 한글이 이상하게 느껴져서;;;;

도대체 심즈는 어떤 게임이길래 이게 수위조절이래;;;;
그 작가에 그독자들이군;;;;;;;;
그래서 심즈 맥에서도 플레이 가능해요????

신분증은 왜 찍어가죠....남의 개인정보를...넘 어이없네요; 
저두 이번 겨울방학에 꼭 운전면허증 딸 거예요&gt;&lt; 
용달 뒤에 동생 태우고 멋즤게 달릴 생각에 싄이 나욧!! 헤헷

제가 제일 고뇌했던 질문은..
&quot;똥맛이 나는 카레를 먹을 것인가?
카레맛이 나는 똥을 먹을 것인가?&quot;
입니다. 초3 아들의 질문...-_-;;;;

작가님 저는 만화가 넘넘 재밌었어요&gt;&lt;
항상 웃음만 가득하시길 바랄게요!
푹 쉬고 오셔요😉

이번 시즌은 뒤통수가 남아나질 않는구만;;

그래도 절제하면 되는 거라니까..
얼른 수술 받고 그것도 소재로 써주셔야 해. 알았죠? 건강하고 유쾌한 모습으로다가

저도 네이버 베도 때부터 작가님 작품 연재 하시는 곳마다 따라 다녔는데..제가 86화를 보는 지금 시점엔 결혼하신지 꽤 되셨겠지만..처음에 결혼 소식 먼저 알게 되었을땐 놀라움이 더 커서 어버버버 하고 제대로 축하댓글을 못 남겼었네요;;  
결혼 진심으로 축하드립니다. 
늘 행복하시고 건강하셨으면 좋겠습니다 !
